import React from 'react';
import '../styles/Hero.css';

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-text">
        <h1>Discover Insights and Reviews</h1>
        <p>Read what past renters have to say</p>
      </div>
    </section>
  );
};

export default Hero;
